import './App.css'
import { BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import Currier from './Currier';
import Home from './Home';
function App() {
  return (
    <Router>
     <Routes>
       <Route path='/' element={<Home/>} />
       <Route path='/currier' element={<Currier/>} />
     </Routes>
   </Router>
  );

}

export default App;
